import logoImg from './logo.png';

class Landing extends Component {
  render() {
    return (
      <div className="info">
        <div className="mt-5 d-flex">
          <div className="col-md-7 float-left mx-auto">
            <h1 className="display-4 text-left">Добро пожаловать в приложение Times.</h1>
            <h1 className="lead text-left mt-4">Добро пожаловать в приложение Times.
            Оно поможет вам в личном тайм-менеджменте. Планируйте свои задачи на день, контролируете время,
            затраченное на них. Учитесь быть продуктивнее!!!</h1>
          </div>
          <div class='icon colmd-4'><img src={logoImg} alt="logo" /></div>
        </div>
        <div>

        </div>
      </div>
    )
  }
}

export default Landing
